import TodoItem from './TodoItem'

const TodoList = (props) => {
    if (
      document.getElementByClass('update-form').style.visibility == 'visible'
    ) {
      document.getElementByClass('button-container').style.visibility = 'hidden'
    }
  const {todos, onDelete, onEdit} = props
  const renderedTodos = todos.map((todo) => (
    <TodoItem key={todo.id} todo={todo} onDelete={onDelete} onEdit={onEdit} />
  ))
  return <div class="update-container">{renderedTodos}</div>
}

export default TodoList
